(3, 'Немного статистики', '<p>Всего за 2 дня нашего существования к нам присоединилось 280 пользователей которые сделали общий вклад около 60000 рублей</p>', '', '', '', '', '', '', '27.03.2015'),
(2, 'Старт проекта', '<p>Здравствуйте, рады сообщить Вам о старте проекта 26.03.2015г</p>\r\n<p>Будем рады если Вы будете инвестировать вместе с нами!</p>', '', '', '', '', '', '', '26.03.2015'),
(4, 'Накрутка проекта', '<p>Обратите внимание!&nbsp; Регистрироваться самим же под собой запрещено!</p>\r\n<p>Такие аккаунты будем блокировать! Без возврата денежных средст!</p>\r\n<p>Пожалуйста не накручивайте проект! Вкладывайте честно!</p>', '', '', '', '', '', '', '27.03.2015');
