(16, 'О нас', '', '', '<p><span style="font-size: large;"><strong>Наш проект ONEINVEST.RU создан на партнерском заработке!</strong></span></p>\r\n<p>Суть проекта проста: <br />- Вы ивестируете деньги (грубо говоря даете деньги нам) под 10 процентов в день!<br />- Мы вкладываем Ваши деньги под более высокие проценты в другие инвестиции.<br /><br />Вы получаете часть заработанных нами денег и свои деньги(вклад) в наш проект!<br /><br />То есть к примеру вложили 1000 рублей в наш проект под 10% в день, мы эту 1000 рублей вложили в другой проект под 20% и заработали деньги!<br /><br />Вы получаете 1000+100 рублей, а мы получаем 100 рублей!<br /><br /><span style="color: #000000; font-size: medium;"><strong>Никаких рисков нет!&nbsp; В отличии от других проектов, которые просто живут благодаря новым пополнениям(вкладам) мы заработываем на получении процентов!</strong></span></p>', 'About us', '', '', '', 'about', 1, 0, 1),
(17, 'FAQ - система ответов на часто задаваемые вопросы:', '', '', '<p><span style="font-size: medium; color: #000000;"><strong>Откуда берутся деньги у проекта?</strong></span></p>\r\n<p>Мы вкладываем Ваши деньги под процент Выше в другие проекты, мы платим 10%&nbsp; Вам. И 10% забераем себе!</p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Когда я получу деньги?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Деньги Вы получите через 24 с момента создания вклада!</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>С какой платежной системой Вы работаете?</strong></span></p>\r\n<p>Мы работаем с <a href="http://payeer.com/?partner=944392" target="_blank"><strong>PAYEER</strong></a></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>В чем Ваш заработок?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Мы вкладываем Ваши деньги под процент Ваше, чем платим Вам.</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Сколько я смогу заработать в данном проекте?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Все зависит от того, сколько Вы будете инвестировать! К примеру Вы инвестировали 1000 рублей, то через 24 часы Вы получите 1100 - то есть чистой прибыли 100 рублей!</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Как быстро делаются выплаты?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Выплаты делаются в автоматическом режиме, сразу как закажите, деньги придут к Вам на кошелек!</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Какую сумму можно вложить в проект?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Все зависит от Вас! Минималка для вклада составляет 100 рублей!</span></p>\r\n<p>&nbsp;</p>\r\n<h2 style="border-radius: 5px;"><span style="font-size: medium; color: #000000;">Для чего приглашать друзей на проект и как это сделать?</span></h2>\r\n<p><span style="font-size: small; color: #808080;">Пригласив друзей в проект, Вы будете получать 10% на свой счет, от каждого вклада который они произведут.<br /> Для того что бы пригласить друзей в проект, воспользуйтесь реферальной ссылкой доступной в разделе "<a href="../ref/">ПАРТНЕРСКАЯ ПРОГРАММА</a>".</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small; color: #808080;"><br /></span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Как мне связаться с Вами?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Вы можете задать свой вопрос через поле <a href="../contacts/">КОНТАКТЫ</a><br /></span></p>', 'FAQ', '', '', '<p><span style="font-size: medium; color: #000000;"><strong>Откуда берутся деньги у проекта?</strong></span></p>\r\n<p>Мы вкладываем Ваши деньги под процент Выше в другие проекты, мы платим 10%&nbsp; Вам. И 10% забераем себе!</p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Когда я получу деньги?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Деньги Вы получите через 24 с момента создания вклада!</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>С какой платежной системой Вы работаете?</strong></span></p>\r\n<p>Мы работаем с <a href="http://payeer.com/?partner=944392" target="_blank"><strong>PAYEER</strong></a></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>В чем Ваш заработок?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Мы вкладываем Ваши деньги под процент Ваше, чем платим Вам.</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Сколько я смогу заработать в данном проекте?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Все  зависит от того, сколько Вы будете инвестировать! К примеру Вы  инвестировали 1000 рублей, то через 24 часы Вы получите 1100 - то есть  чистой прибыли 100 рублей!</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Как быстро делаются выплаты?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Выплаты делаются в автоматическом режиме, сразу как закажите, деньги придут к Вам на кошелек!</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Какую сумму можно вложить в проект?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Все зависит от Вас! Минималка для вклада составляет 100 рублей!</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><strong>Как мне связаться с Вами?</strong></span></p>\r\n<p><span style="font-size: small; color: #808080;">Вы можете задать свой вопрос через поле <a href="../contacts/">КОНТАКТЫ</a><br /></span></p>', 'faq', 1, 0, 1),
