(22, 'Правила', '', '', '<p>Проверка</p>', '', '', '', '', 'rules', 1, 0, 1),
(23, 'Правила', '', '', '<ul class="arrow">\r\n<li style="text-align: justify;"><span class="highlight green">Персональная ответственность и полная самостоятельность</span>.  Решение вкладывать деньги в какой-либо проект каждый из инвесторов  принимает сам. И ответственность за неудачный вклад ни на кого другого  переложена быть не может.</li>\r\n<li style="text-align: justify;"><span class="highlight green">Разумность риска</span>.  Для вкладов нужно привлекать такие суммы, которые не влияют на здоровье  и благосостояние, как самого инвестора, так и его близких.</li>\r\n<li style="text-align: justify;"><span class="highlight green">Осторожность</span>. Следует помнить, что самые привлекательные условия &ndash; в самых ненадежных проектах.</li>\r\n<li style="text-align: justify;"><span class="highlight green">Информированность</span>.  Принимать решение о вкладе средств нужно после всестороннего и  тщательного анализа проекта, желательно на основании информации из  независимых источников. Необходимо иметь свою базу данных по  инвестиционным проектам и их владельцам.</li>\r\n<li style="text-align: justify;"><span class="highlight green">Диверсификация вкладов</span>. Никогда не стоит вкладывать все свои денежные ресурсы в один единственный проект, сколь бы надежным. Каждый хайп прекращает свое существование рано или поздно. Но не каждый из них сможет выполнить свои обязательства перед вкладчиками.</li>\r\n<li style="text-align: justify;"><span class="highlight green">Предусмотрительность</span>. Проценты следует снимать каждый день (если такая возможность имеется).</li>\r\n<li style="text-align: justify;"><span class="highlight green">Уважительное отношение к своим рефералам</span>.  Не надо уклонятся от указания при регистрации своих рефералов. Если  кто-то привел вас в проект, то откажите ему в небольшом вознаграждении.  Ведь сам инвестор при этом не несет никаких потерь. Зато в дальнейшем он  сам вправе рассчитывать на столь же вежливое отношение к себе от уже  своих рефералов.</li>\r\n<li style="text-align: justify;"><span class="highlight green">Безопасность</span>.  Позаботьтесь о том, чтобы посторонние лица не могли получить доступ к  вашим электронным кошелькам и счетам. Не следует хранить такую  информацию на компьютере, который подключен к Интернету.</li>\r\n</ul>', '', '', '', '', 'rules', 1, 22, 1);
